eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   surgeriesItems: () => (/* binding */ surgeriesItems)\n/* harmony export */ });\nconst surgeriesItems = [\n    {\n        id: 1,\n        type: \"external\",\n        mix: \"facials\",\n        href: \"/assets/images/surgeries/full-project-1.jpg\",\n        imgSrc: \"/assets/images/surgeries/dpfacelift.jpg\",\n        imgAlt: \"Deep Plane Facelift\",\n        title: \"Deep Plane Facelift\",\n        descr: `A cirurgia de Lifting Facial Deep Plane é considerada uma das técnicas cirúrgicas \r\n    mais avançadas e inovadoras para rejuvenescimento facial, combinando resultados mais naturais \r\n    e duradouros com o benefício de não possuir praticamente nenhuma cicatriz visível.`,\n        url: \"deep-plane-facelift\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        O principal diferencial do Lifting Facial Deep Plane, como o próprio nome sugere, é a atuação em uma camada mais \r\n        profunda dos músculos. Ela atua diretamente entre o sistema SMAS, ou Sistema Músculo-Aponeurótico Superficial, \r\n        que provoca os sinais de envelhecimento facial e a camada muscular mais profunda, responsável pela expressão facial.\r\n      </p>\r\n      <p>\r\n        O principal objetivo do Lifting Facial Deep Plane está na liberação e reposicionamento das camadas musculares e de gordura, \r\n        sem provocar tensão nos tecidos, resultando em uma aparência mais jovem e sem o aspecto de “pele esticada”.\r\n      </p>\r\n      <p>\r\n        Em geral, os ligamentos dos tecidos da face são liberados para um reposicionamento natural em todo o rosto e pescoço, \r\n        restaura a forma e o volume das bochechas sem a necessidade da aplicação de preenchimento ou gordura. \r\n        Também são liberados os ligamentos que prendem a mandíbula para que ela possa ser levantada, \r\n        criando uma aparência de linha da mandíbula mais lisa e nítida.\r\n      </p>\r\n      <p>\r\n        Além da face, também é utilizada em conjunto com a cervicoplastia, permitindo um maior refinamento da área do \r\n        pescoço e linha do maxilar com resultados mais duradouros.\r\n      </p><br>\r\n      <div>\r\n        <div class=\"ratio ratio-16x9\">\r\n          <iframe\r\n            width=\"1280\"\r\n            height=\"720\"\r\n            src=\"https://www.youtube.com/embed/741HqtRgGIM?si=sos8FUDdaEusQeR4\"\r\n            title=\"Deep Plane: Porquê eu escolhi essa técnica inovadora\"\r\n            frameborder=\"0\"\r\n            allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\"\r\n            allowfullscreen>\r\n          </iframe>\r\n        </div>\r\n        <p class=\"pt-2 small\">\r\n          <strong>Porquê escolhi a técnica inovadora de rejuvenescimento facial Deep Plane Facelift</strong><br>\r\n          <em>Acompanhe a explicação do Dr. Thomas Benson</em>\r\n        </p>\r\n      </div>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Deep Plane vs. Liftings Tradicionais</h2>\r\n      <p>\r\n        Uma das maiores preocupações dos pacientes está na busca por resultados mais naturais, sem a aparência esticada \r\n        comum às técnicas tradicionais.\r\n      </p>\r\n      <p>\r\n        A razão para isso é que em outras técnicas mais comuns apenas as camadas mais superficiais da pele são reposicionadas \r\n        e suturas são aplicadas para levantar o conjunto de músculos SMAS, deixando a pele com aspecto mais firme porém sem \r\n        eliminar o problema de bochechas caídas.\r\n      </p>\r\n      <p>\r\n        Como resultado, muitos cirurgiões acabam realizando a correção por meio de lipoenxertia, muitas vezes fazendo com \r\n        que as bochechas evidenciem a correção.\r\n      </p>\r\n      <p>\r\n        Além de resultados mais naturais, a recuperação de um Lifting Facial Deep Plane é mais rápida e simples. É comum \r\n        em outros tipos de lifting facial o rompimento de vasos sanguíneos, o que ocasiona hematomas maiores e recuperação mais lenta.\r\n      </p><br>\r\n      <div>\r\n        <div class=\"ratio ratio-16x9\">\r\n          <iframe\r\n            width=\"1280\"\r\n            height=\"720\"\r\n            src=\"https://www.youtube.com/embed/gPs3-B48ffY?si=aHDo7uWaKcrINxR2\"\r\n            title=\"Como funciona a técnica Deep Plane - Thomas Benson\"\r\n            frameborder=\"0\"\r\n            allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\"\r\n            allowfullscreen>\r\n          </iframe>\r\n        </div>\r\n        <p class=\"pt-2 small\">\r\n          <strong>Como funciona a técnica Deep Plane Facelift?</strong><br>\r\n          <em>Comentado pelo Dr. Thomas Benson</em>\r\n        </p>\r\n      </div>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Recuperação e cicatrizes</h2>\r\n      <p>\r\n        A recuperação após um Lifting Facial Deep Plane geralmente envolve poucos hematomas e uma recuperação \r\n        mais rápida por não existir cortes em vasos sanguíneos entre o músculo e a pele. Alguns hematomas e inchaço \r\n        ao redor das áreas reposicionadas podem aparecer nos primeiros dias e desaparecerão gradualmente.\r\n      </p>\r\n      <p>\r\n        Alguns medicamentos para dor podem ser prescritos para ajudar o paciente a se sentir mais confortável durante \r\n        o processo de cicatrização. Também é importante o uso de compressas frias para aliviar o inchaço, além do descanso \r\n        para a recuperação.\r\n      </p>\r\n      <p>\r\n        O Lifting Facial Deep Plane possui incisões que cicatrizam com mínima ou nenhuma cicatriz visível. Como nesta técnica \r\n        a pele não é separada dos músculos, não há tensão nas linhas de incisão depois que são fechadas, o que permite que a \r\n        incisão cicatrize como uma linha imperceptível.\r\n      </p>\r\n      <p>\r\n        Principais benefícios do Lifting Facial Deep Plane\r\n      </p>\r\n      <ul>\r\n        <li>Menor tempo cirúrgico</li>\r\n        <li>Resultados mais naturais</li>\r\n        <li>Restauração do volume natural</li>\r\n        <li>Remoção do excesso de pele</li>\r\n        <li>Pele mais lisa e com aspecto jovem</li>\r\n        <li>Recuperação mais rápida</li>\r\n        <li>Cicatrizes imperceptíveis</li>\r\n        <li>Resultados mais duradouros</li>\r\n      </ul><br>\r\n      <div>\r\n        <div class=\"ratio ratio-16x9\">\r\n          <iframe\r\n            width=\"1280\"\r\n            height=\"720\"\r\n            src=\"https://www.youtube.com/embed/1rpzysLsi6w?si=RWWz_-x14TKRUYSv\"\r\n            title=\"Deep Neck Lift explicado pelo Dr. Thomas Benson\"\r\n            frameborder=\"0\"\r\n            allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\"\r\n            allowfullscreen>\r\n          </iframe>\r\n        </div>\r\n        <p class=\"pt-2 small pb-0 mb-0\">\r\n          <strong>Deep Necklift explicado pelo Dr. Thomas Benson</strong><br>\r\n          <em>Confira o vídeo</em>\r\n        </p>\r\n      </div>\r\n    </div>`\n    },\n    {\n        id: 2,\n        type: \"external\",\n        mix: \"facials\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/rinoplastia.jpg\",\n        imgAlt: \"Rinoplastia\",\n        title: \"Rinoplastia\",\n        descr: `Indicada para quem quer modelar o tamanho e a proporção do nariz, a rinoplastia é uma \r\n    das cirurgias mais procuradas para finalidades estéticas. Vale destacar que este tipo de cirurgia \r\n    também é aconselhável para corrigir problemas estruturais do nariz.`,\n        url: \"rinoplastia\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        Dentre os diversos procedimentos de cirurgia plástica disponíveis atualmente, a rinoplastia \r\n        (nome técnico para a cirurgia do nariz) é o tipo mais complexo de ser realizado com excelência.\r\n      </p>\r\n      <p>\r\n        O nariz é um dos elementos mais marcantes do rosto de uma pessoa e pequenas irregularidades no formato \r\n        podem causar sérios problemas na autoestima do paciente. Atualmente, as técnicas de rinoplastia desenvolvidas \r\n        conseguem corrigir essas imperfeições de forma a harmonizar a simétrica facial e auxiliar num melhor funcionamento \r\n        do sistema respiratório.\r\n      </p>\r\n      <p>\r\n        Além da harmonia com o rosto, na prática, a rinoplastia pode melhorar a respiração, o sentido do olfato e trazer \r\n        mais qualidade de vida para quem sofre tanto com deformidades adquiridas quanto congênitas.Em nossa clínica realizamos \r\n        principalmente a técnica estruturada, que é uma técnica menos agressiva e com resultados mais naturais e esteticamente \r\n        equilibrado para o rosto.\r\n      </p>\r\n      <p>\r\n        É a técnica utilizada por cirurgiões mais experientes em procedimentos faciais, separando todas as subunidades do \r\n        nariz e normalmente retirando cartilagem do septo, fazendo as modificações das estruturas de forma precisa. Com isso, \r\n        o resultado é muito mais duradouro e com menor risco de alterações futuras.\r\n      </p>\r\n      <p>\r\n        De forma geral, o médico avalia a proporção da face, os ângulos nasais, as características da pele e o que precisa \r\n        ser melhorado também para a qualidade de vida. Por isso é muito importante que a escolha do médico seja criteriosa, \r\n        afinal, a rinoplastia é um processo artesanal e que requer habilidades precisas e certeiras para que tudo funcione \r\n        conforme o esperado.\r\n      </p>\r\n      <p>\r\n        Além disso, você encontra em nossa clínica o apoio de profissionais qualificados para sanar todas as suas dúvidas, \r\n        seja referente ao processo cirúrgico ou aos cuidados pós-operatórios. Caso esteja considerando passar por uma \r\n        rinoplastia, agende uma consulta e obtenha todas as informações necessárias para te auxiliar nessa decisão.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Vantagens da técnica estruturada</h2>\r\n      <p>\r\n        É importante salientar que após uma cirurgia de Rinoplastia o nariz continua sofrendo o efeito de diversas forças, \r\n        como por exemplo a da respiração que gera pressão negativa nas vias aéreas. Com isso, o tecido cicatricial que se \r\n        formará em torno das cartilagens posicionadas poderá sofrer pequenas deformações com o tempo, até mesmo alterando a \r\n        posição dessas cartilagens.\r\n      </p>\r\n      <p>\r\n        Por conta disso, a Rinoplastia Estruturada tem como objetivo o fortalecimento dessa estrutura nasal, o que contribui \r\n        para resultados mais duradouros, além de maior precisão ao esculpir a cartilagem, proporcionando um resultado mais \r\n        natural e harmonioso.\r\n      </p>\r\n      <p>\r\n        Além disso, dependendo do caso, o cirurgião poderá priorizar as incisões internas no nariz, o que contribui para que \r\n        fiquem completamente imperceptíveis.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Anestesia</h2>\r\n      <p>\r\n        Com os avanços em medicamentos e na tecnologia de equipamentos para controle e monitoramento do paciente, a anestesia \r\n        geral se tornou a mais segura quando bem indicada.\r\n      </p>\r\n      <p>\r\n        Devemos levar em consideração fatores muito importantes como: doenças pré-existentes, exames pré-operatórios, \r\n        profissionais competentes, equipamentos modernos e hospitais com infraestrutura adequada ao porte cirúrgico.\r\n      </p>\r\n      <p>\r\n        É de total relevância saber o histórico do paciente e ter uma avaliação clínica que permita indicar o procedimento.\r\n      </p>\r\n      <p>\r\n        O monitoramento adequado utilizando-se de todos os recursos tecnológicos hoje acessíveis, permitem o controle da \r\n        frequência cardíaca, pressão arterial, oxigenação, controle das vias aéreas, manutenção da temperatura corpórea, \r\n        prevenção de trombose e até mesmo determinação do nível de consciência dos pacientes.\r\n      </p>\r\n    </div>\r\n    `\n    },\n    {\n        id: 3,\n        type: \"external\",\n        mix: \"facials\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/lp-facial.jpg\",\n        imgAlt: \"Lipoenxertia Facial\",\n        title: \"Lipoenxertia Facial\",\n        descr: `A Lipoenxertia Facial é um procedimento que restaura o contorno e a forma jovem do rosto, \r\n    bem como a rigidez da pele por meio da aplicação de gordura retirada do abdômen ou de outras partes \r\n    do corpo, purificada e injetada nas áreas que necessitam da recuperação do seu volume natural.`,\n        url: \"lipoenxertia-facial\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        A Lipoenxertia Facial é uma das técnicas que mais revolucionou as cirurgias plásticas de Lifting Facial, \r\n        além de ser uma das técnicas mais avançadas em cirurgia plástica nos últimos anos.\r\n      </p>\r\n      <p>\r\n        Diversos procedimentos de lifting facial foram criados com o objetivo de rejuvenescimento facial, a \r\n        maioria deles concluindo em uma cirurgia mais extensa e com resultados menos naturais.Algo que foi notado \r\n        durante esse período é que o rosto envelhece não somente devido à queda pela falta de suporte, mas também \r\n        por perder o volume natural de bochechas, na linha do maxilar e sob os olhos.\r\n      </p>\r\n      <p>\r\n        É um procedimento que utiliza a gordura retirada do abdômen ou de outras partes do corpo, purificada e \r\n        aplicada nas regiões do rosto que perderam volume, que além de oferecer resultados mais naturais também \r\n        contribui na qualidade da pele e na redução de pequenas rugas e imperfeições.\r\n      </p>\r\n      <p>\r\n        Este procedimento restaura o contorno e a forma jovem do rosto, bem como a rigidez da pele. Diferentemente \r\n        dos procedimentos de enxertia de gordura que utilizam técnicas anteriores, na Lipoenxertia Facial, a gordura \r\n        passa por processamento e purificação, maximizando e melhorando a qualidade da pele e dos tecidos em geral.\r\n      </p>\r\n    </div>\r\n    `\n    },\n    {\n        id: 4,\n        type: \"external\",\n        mix: \"facials\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/lf-labial.jpg\",\n        imgAlt: \"Lifting Labial\",\n        title: \"Lifting Labial\",\n        descr: `Um dos procedimentos faciais que vem ganhando atenção nos últimos anos é o lifting labial, \r\n    também chamado de lip lift ou lip lifting ele levanta o lábio superior, corrigindo a queda natural \r\n    (que o preenchimento não consegue corrigir) e dá mais volume.`,\n        url: \"lifting-labial\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        A cirurgia de Lifting Labial é um procedimento que pode ser realizada tanto em pessoas de mais idade \r\n        para rejuvenescimento facial, corrigindo a queda natural do lábio superior, quanto em jovens que tem \r\n        como objetivo o aumento labial, já que ao elevar o lábio superior dá mais volume, expondo mais os dentes \r\n        superiores e um sorriso mais harmônico.\r\n      </p>\r\n      <p>\r\n        Com o envelhecimento, uma das consequências é a perda de gordura nos lábios, fazendo com que eles cedam \r\n        devido à perda de suporte.O lifting de lábios é o procedimento mais indicado para quem deseja corrigir altura \r\n        e volume dos lábios de forma permanente, evitando a necessidade de aplicações constantes de preenchimento labial.\r\n      </p>\r\n      <p>\r\n        Quando você ouve o termo Lip Lifting, ou Lifting Labial, em geral, se refere a um lifting de lábio superior. A \r\n        operação pode ser adaptada para elevar diferentes regiões do lábio, tornando-os mais modelados e com contorno mais definido.\r\n      </p>\r\n      <p>\r\n        Ao corrigir os casos de pacientes que têm uma grande distância entre o nariz e o lábio superior, é conferida uma aparência \r\n        mais harmoniosa com o resto do rosto. Por esta razão, existem pacientes mais jovens que possuem lábio superior mais longo \r\n        que se beneficiam imensamente com esta cirurgia. Quando realizado em pacientes mais velhos, ela restaura a aparência jovem \r\n        do rosto. Essa alteração sutil faz com que as pessoas pareçam anos mais jovens e rejuvenescidas.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Resultados mais naturais</h2>\r\n      <p>\r\n        O procedimento de Lifting Labial é frequentemente realizado em conjunto com as aplicações de laser. Para quem deseja \r\n        principalmente o aumento de volume, em muitos casos é utilizada em conjunto a enxertia de gordura (ou lipoenxertia, um \r\n        procedimento reconhecido mundialmente onde uma porção de gordura é retirada do abdômen ou de outras partes do corpo, \r\n        purificada e injetada nas áreas necessárias), que além de oferecer resultados mais naturais também contribui na qualidade \r\n        da pele e na redução de pequenas rugas e imperfeições.\r\n      </p>\r\n    </div>\r\n    `\n    },\n    {\n        id: 5,\n        type: \"external\",\n        mix: \"facials\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/lf-frontal.jpg\",\n        imgAlt: \"Lifting Frontal\",\n        title: \"Lifting Frontal\",\n        descr: `Testa franzida, marcas de expressão, rugas e olhar cansado. Essas são apenas algumas das \r\n    consequências do envelhecimento e entre as cirurgias plásticas, o lifting frontal é uma alternativa \r\n    que auxilia na melhora da aparência.`,\n        url: \"lifting-frontal\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        O Lifting Frontal é um procedimento cirúrgico para rejuvenescimento facial, suavizando as linhas de expressão \r\n        e rugas na região da testa. O cirurgião eleva a pele e os tecidos da parte superior da face com o auxílio de uma \r\n        câmera endoscópica com alta precisão, resultando em uma aparência mais jovem e renovada.\r\n      </p>\r\n      <p>\r\n        O Lifting Frontal é um procedimento cirúrgico para rejuvenescimento facial, suavizando as linhas de expressão e \r\n        rugas na região da testa. O cirurgião eleva a pele e os tecidos da parte superior da face com o auxílio de uma câmera \r\n        endoscópica com alta precisão, resultando em uma aparência mais jovem e renovada.\r\n      </p>\r\n      <p>\r\n        A técnica consiste em realizar pequenas incisões para que os ligamentos e músculos sejam reposicionados de forma que \r\n        a face ganhe uma aparência mais jovem, amenizando o envelhecimento, reduzindo as marcas e podendo também arquear as \r\n        sobrancelhas, com cicatrizes praticamente imperceptíveis.\r\n      </p>\r\n      <p>\r\n        Por conta das incisões menores, os pacientes que realizam um lifting frontal com via endoscópica passam por um período \r\n        de recuperação menor, retornando às suas atividades normais mais cedo e com resultados mais duradouros comparados aos \r\n        métodos mais comuns realizados.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Técnicas combinadas</h2>\r\n      <p>\r\n        Antes de optar pelo lifting frontal, é imprescindível conversar com o cirurgião para o alinhamento das expectativas e \r\n        dos resultados possíveis. O lifting frontal traz ótimos resultados quando realizado individualmente, porém é possível \r\n        ir além e renovar a aparência como um todo utilizando-o em combinação com outros procedimentos.\r\n      </p>\r\n      <p>\r\n        Algumas das principais técnicas muito combinadas com o lifting frontal são: o lifting facial, que rejuvenesce a região \r\n        da face e a blefaroplastia para a região dos olhos, dessa forma os resultados podem ser ainda mais potencializados.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Endotine® Forehead Device</h2>\r\n      <p>\r\n        Uma das tecnologias que utilizamos em nossas cirurgias é o Endotine® Forehead Device, que é uma solução inovadora \r\n        projetada especificamente para elevar o tecido da testa na cirurgia de Lifting Frontal. Sua estrutura única fornece \r\n        vários pontos de contato com o tecido da testa, criando uma distribuição mais uniforme e suave da força de retenção.\r\n      </p>\r\n      <p>\r\n        Outras opções, como parafusos e suturas, normalmente fornecem apenas um ponto de contato que pode romper os tecidos \r\n        moles, afetando adversamente a confiabilidade da elevação da sobrancelha.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Cuidados depois da cirurgia</h2>\r\n      <p>\r\n        A recuperação após um Lifting Frontal via endoscopia possui um pós-operatório mais simples comparado às técnicas \r\n        mais tradicionais. Em dez dias, a maioria dos pacientes já podem retomar suas atividades de forma normal.\r\n      </p>\r\n      <p>\r\n        Nos primeiros dias é comum o aparecimento de hematomas e inchaço na região das incisões, por isso a recomendação \r\n        é para manter a cabeça elevada sempre que possível, realizando a aplicação de compressas frias para ajudar a reduzir \r\n        o inchaço. Alguns pacientes sentem dores de cabeça entre 24 e 48 horas após a cirurgia. Os sinais mais visíveis da \r\n        cirurgia devem desaparecer após três semanas e o crescimento normal dos cabelos será retomado nos meses seguintes.\r\n      </p>\r\n      <p>\r\n        Entre as indicações, vale lembrar que o paciente só pode lavar o cabelo depois de três dias e deve cuidar dos curativos \r\n        conforme orientação médica, evitando o uso de maquiagem por alguns dias. Também é necessário evitar esforço físico, \r\n        como baixar a cabeça por exemplo. Evitar a exposição ao sol também é importante para que a cicatriz fique protegida.\r\n      </p>\r\n      <p>\r\n        Em casos de dor ou desconforto, converse com o médico sobre analgésicos e anti-inflamatórios que podem ser usados.\r\n      </p>\r\n    </div>\r\n    `\n    },\n    {\n        id: 6,\n        type: \"external\",\n        mix: \"facials\",\n        href: \"/assets/images/portfolio/full-project-6.jpg\",\n        imgSrc: \"/assets/images/surgeries/blefaroplastia.jpg\",\n        imgAlt: \"Blefaroplastia\",\n        title: \"Blefaroplastia\",\n        descr: `A região dos olhos, quando apresenta os efeitos de envelhecimento confere uma aparência cansada, \r\n    causando desconforto e incômodo. A blefaroplastia é indicada para pacientes que apresentam alterações \r\n    típicas do envelhecimento, como o excesso de pele nas pálpebras.`,\n        url: \"blefaroplastia\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        Pálpebras caídas, pés de galinha e olheiras de cansaço são sinais de envelhecimento comuns na região dos olhos. \r\n        Para corrigir estes problemas, a blefaroplastia é uma cirurgia plástica que pode amenizar este quadro, rejuvenescendo \r\n        o rosto e proporcionado a melhora da auto-estima e o bem-estar do paciente.\r\n      </p>\r\n      <p>\r\n        A blefaroplastia é o procedimento de elevação das pálpebras, no qual o cirurgião elimina as bolsas de gordura e \r\n        ameniza o caimento natural do envelhecimento. As pálpebras superiores caídas são o resultado do excesso de flacidez \r\n        da pele e as pálpebras inferiores ficam inchadas, bolsas se desenvolvem com a idade devido ao prolapso de gordura \r\n        embaixo dos olhos. Essas mudanças geralmente contribuem para uma aparência mais envelhecida.\r\n      </p>\r\n      <p>\r\n        Para a pálpebra superior, são marcadas todas as linhas e vincos individuais das pálpebras para manter as incisões \r\n        o mais invisíveis possível ao longo das dobras naturais. A incisão é feita e uma quantidade precisa de excesso de \r\n        gordura, músculo e pele solta que estão contribuindo para o problema é removida.\r\n      </p>\r\n      <p>\r\n        Na inferior, a incisão é feita em um local imperceptível, apenas alguns milímetros abaixo da linha dos cílios e ao \r\n        longo das dobras da pálpebra inferior. Mais uma vez, uma porção precisa de pele, gordura e músculos são removidos com \r\n        precisão. Suturas extremamente finas são então utilizadas para fechar meticulosamente as incisões, minimizando assim \r\n        a visibilidade de qualquer cicatriz.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Técnicas combinadas</h2>\r\n      <p>\r\n        Para realizar a blefaroplastia, o paciente precisa estar em boas condições de saúde física e alinhar as expectativas \r\n        emocionais com o cirurgião. Além de passar por avaliação médica, provavelmente o paciente terá que passar por exames \r\n        laboratoriais de sangue.\r\n      </p>\r\n      <p>\r\n        Não é aconselhável o uso de remédios anticoagulantes antes da cirurgia. Bebida e cigarro também devem estar fora da rotina \r\n        do paciente antes do procedimento e 8 horas antes da cirurgia, é necessário fazer jejum absoluto.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Cuidados depois da cirurgia</h2>\r\n      <p>\r\n        Após a cirurgia é comum que a região operada fique sensível e um pouco inchada, por isso o tempo de repouso varia entre \r\n        uma semana e um mês. Neste período, o cuidado deve ser redobrado para garantir uma cicatrização segura e uma recuperação \r\n        adequada.\r\n      </p>\r\n      <p>\r\n        Por isso, preste atenção nas dicas:\r\n      </p>\r\n\r\n      <ul>\r\n        <li>Evite exposição ao sol, vento e friagem;</li>\r\n        <li>Evite coçar os olhos;</li>\r\n        <li>Não deite de lado</li>\r\n        <li>Quando for fazer compressas, use soro fisiológico;</li>\r\n        <li>Durma com dois travesseiros para manter a cabeça elevada;</li>\r\n      </ul>\r\n\r\n      <p>\r\n        Em caso de dúvida, marque o retorno ao médico;\r\n      </p>\r\n    </div>\r\n    `\n    },\n    {\n        id: 7,\n        type: \"external\",\n        mix: \"facials\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/pr-cutaneo.jpg\",\n        imgAlt: \"Preenchimento Cut\\xe2neo\",\n        title: \"Preenchimento Cut\\xe2neo\",\n        descr: `A melhor indicação do ácido hialurônico se ocorre nos sulcos faciais que se formam com o passar \r\n    dos anos como o sulco nasogeniano) e os sulcos ao redor dos lábios. Também pode ser utilizado para aumentar \r\n    os lábios em pacientes com lábios finos.`,\n        url: \"preenchimento-cutaneo\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        Com o tempo, é inevitável que marcas de expressão, sulcos faciais, rugas e sinais de envelhecimento fiquem \r\n        visíveis em nossa pele. Por isso, manter a elasticidade, recuperar o colágeno e a consistência da pele é um desafio. \r\n        Para solucionar estes problemas, o preenchimento cutâneo é um dos tratamentos possíveis.\r\n      </p>\r\n      <p>\r\n        Com uma técnica pouco invasiva, o procedimento consiste na aplicação do ácido hialurônico sobre o local desejado, \r\n        geralmente com uma injeção e anestesia local. Além dessas vantagens, diferente de outros procedimentos, o paciente \r\n        precisa sim ter alguns cuidados após o preenchimento mas não é necessário ficar em repouso.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Resultados</h2>\r\n      <p>\r\n        Na prática, os resultados do preenchimento cutâneo duram de 15 a 18 meses. Com o ácido hialurônico, as rugas são \r\n        literalmente preenchidas e as linhas de expressão ficam com um aspecto mais suave e discreto. Além desta finalidade, \r\n        esta técnica também é muito indicada para pacientes que querem aumentar os lábios, contornar a maçã do rosto e corrigir \r\n        o chamado “bigode chinês” (sulco nasogiano).\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Cuidados</h2>\r\n      <p>\r\n        Todo procedimento estético precisa de uma avaliação médica e é sempre indicado que o paciente alinhe suas expectativas \r\n        com a realidade. Com efeitos impressionantes, o preenchimento cutâneo é sim uma alternativa para as marcas do tempo, \r\n        mas é importante lembrar que o envelhecimento é um processo natural.\r\n      </p>\r\n      <p>\r\n        Por isso, além do procedimento estético, nunca é demais reforçar alguns cuidados como:\r\n      </p>\r\n\r\n      <ul>\r\n        <li>Cuidar da alimentação;</li>\r\n        <li>Se hidratar regularmente;</li>\r\n        <li>Evitar o excesso de exposição ao sol;</li>\r\n      </ul>\r\n    </div>\r\n    `\n    },\n    {\n        id: 8,\n        type: \"external\",\n        mix: \"facials\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/otoplastia.jpg\",\n        imgAlt: \"Otoplastia\",\n        title: \"Otoplastia\",\n        descr: `A otoplastia ou cirurgia plástica das orelhas atua na correção da orelha em abano. A orelha em \r\n    abano consiste no afastamento das orelhas em relação a cabeça, deixando a orelha mais aparente e conferindo \r\n    a impressão de que elas são maiores.`,\n        url: \"otoplastia\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        A chamada “orelha de abano” que provoca desproporção no tamanho e no formato das orelhas é um problema que atinge \r\n        de 2% a 5% da população de acordo com a Sociedade Brasileira de Cirurgia Plástica.\r\n      </p>\r\n      <p>\r\n        Para corrigir este problema, a otoplastia é a cirurgia plástica mais indicada. Na prática, a otoplastia é realizada \r\n        por meio de uma incisão atrás da orelha. Durante a cirurgia, o médico tira uma pequena parte da cartilagem e faz todo \r\n        um processo para que as orelhas fiquem na posição mais adequada possível, aproximando as orelhas da cabeça.\r\n      </p>\r\n      <p>\r\n        Após o fechamento das incisões, coloca-se um curativo ao redor das orelhas por um período de 24 horas para proteger a \r\n        região operada.\r\n      </p>\r\n      <p>\r\n        Os resultados da otoplastia em geral são muito positivos e a cirurgia não deixa cicatrizes profundas, considerando que \r\n        os pontos ficam escondidos atrás das orelhas. Porém, vale lembrar que não é todo caso que terá 100% de simetria, afinal, \r\n        a própria natureza é assimétrica.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Como e quando fazer</h2>\r\n      <p>\r\n        Quanto mais cedo a cirurgia for feita, melhor será o resultado. É comum que pais fiquem com receio em qual a melhor hora \r\n        para realizar a otoplastia em crianças que já nasceram com as orelhas proeminentes, e não é à toa, afinal a otoplastia é \r\n        uma intervenção cirúrgica.\r\n      </p>\r\n      <p>\r\n        Contudo, a faixa etária dos 5 aos 7 anos é bastante indicada para a cirurgia, pois nesta fase a orelha da criança está \r\n        totalmente formada e com o passar do tempo, a desproporção e o incômodo pode ser ainda maior.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Cuidados pós-operatórios</h2>\r\n      <p>\r\n        Quando o cirurgião fecha as incisões, automaticamente a pessoa fica com um curativo ao redor da cirurgia em forma de \r\n        capacete por um período de 24 horas. Depois deste tempo, o capacete é substituído por uma faixa de compreensão que precisa \r\n        ficar no local durante um mês e para manter o sucesso da cirurgia a pessoa precisa naturalmente ter alguns cuidados.\r\n      </p>\r\n      <p>\r\n        São eles:\r\n      </p>\r\n\r\n      <ul>\r\n        <li>Evitar exposição ao sol;</li>\r\n        <li>Não praticar esportes;</li>\r\n        <li>Evitar mexer e coçar a região;</li>\r\n      </ul>\r\n\r\n      <p>\r\n        Ao seguir essas orientações, o paciente evita que os pontos se rompam, além de infecções e possibilidade de uma nova cirurgia.\r\n      </p>\r\n    </div>\r\n    `\n    },\n    {\n        id: 9,\n        type: \"external\",\n        mix: \"others\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/braquioplastia.jpg\",\n        imgAlt: \"Braquioplastia\",\n        title: \"Braquioplastia\",\n        descr: `A braquioplastia é indicada para pacientes com flacidez na região dos braços. Isso pode ocorrer \r\n    devido a maus hábitos alimentares, sedentarismo ou fatores genéticos. Muitas vezes esse problema estético \r\n    nos braços pode incomodar e gerar insegurança.`,\n        url: \"braquioplastia\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        Se você tem gorduras localizadas e flacidez nos braços que popularmente é conhecida como a “asa de morcego”, a chamada \r\n        braquioplastia ou lifting branquial pode ser a solução.\r\n      </p>\r\n      <p>\r\n        Com duas horas de duração, a cirurgia é feito sob anestesia local e sedação. Durante o procedimento, o cirurgião faz uma \r\n        incisão na parte interna do braço e assim retira os excessos de pele e de gordura do local.\r\n      </p>\r\n      <p>\r\n        É comum que a braquioplastia também possa ser complementada com outros procedimentos, e, nestes casos, o paciente também \r\n        passa por uma anestesia geral.\r\n      </p>\r\n      <p>\r\n        É importante lembrar que a cirurgia fica numa região muito exposta e, por isso, é comum que as cicatrizes apareçam até o \r\n        período de recuperação completo que pode variar entre um e dois anos.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Qual a melhor técnica?</h2>\r\n      <p>\r\n        Muita gente se pergunta se a braquioplastia é a melhor solução, e de fato, esta é uma dúvida muito pertinente. No momento \r\n        da avaliação, o cirurgião pode avaliar junto com o paciente qual a melhor opção. Em alguns casos, o aumento da gordura \r\n        pode ser resolvido com uma lipoaspiração.\r\n      </p>\r\n      <p>\r\n        Em outros, uma alimentação balanceada e hábitos saudáveis podem resolver o problema. Mas se nada funcionar, a braquioplastia \r\n        é uma opção que traz resultados muito positivos. É importante entender o processo e tirar as dúvidas com um especialista \r\n        de confiança.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Cuidados</h2>\r\n      <p>\r\n        Após a cirurgia, os pacientes devem ficar de repouso num período de três a cinco dias. Além disso, é necessário manter os \r\n        braços perto do corpo num período de até três semanas. É bom evitar esforço físico na região durante o primeiro mês para \r\n        que a cicatrização dos tecidos ocorra sem o alargamento das cicatrizes.\r\n      </p>\r\n      <p>\r\n        O paciente também deve usar cintas de compressão durante um ou dois meses para que o inchaço da região operada seja reduzido. \r\n        E por fim, se houver possibilidades, a drenagem linfática é uma boa ideia para otimizar a absorção do edema nesta fase de \r\n        recuperação.\r\n      </p>\r\n    </div>\r\n    `\n    },\n    {\n        id: 10,\n        type: \"external\",\n        mix: \"others\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/abdominoplastia.jpg\",\n        imgAlt: \"Abdominoplastia\",\n        title: \"Abdominoplastia\",\n        descr: `Assim como a lipoaspiração, a abdominoplastia é uma cirurgia feita para retirar o excesso de \r\n    pele na barriga, remodelando a região. Muito indicada para pacientes que passaram por uma gravidez recente \r\n    ou fizeram uma cirurgia bariátrica.`,\n        url: \"abdominoplastia\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        Assim como a lipoaspiração, a abdominoplastia é uma cirurgia que pode ser utilizada para remodelar a região do \r\n        abdômen. Muito indicada para pacientes que passaram por uma gravidez recente ou fizeram uma cirurgia bariátrica, \r\n        a abdominoplastia consiste no tratamento do excesso de pele, da gordura localizada e da correção do afastamento \r\n        dos músculos que ficam no abdome.\r\n      </p>\r\n      <p>\r\n        A cirurgia dura em média 3 horas e durante este período o médico precisa fazer uma incisão inferior do abdome. \r\n        Depois dessa incisão, a pele e a gordura são separadas da parede muscular e, desta forma, é possível aproximar os \r\n        músculos que reforçam a parede abdominal. Feito isso, o cirurgião retira o excesso de pele e de gordura e fecha a incisão.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Antes e depois da cirurgia</h2>\r\n      <p>\r\n        Antes da cirurgia, o paciente deve evitar o consumo de medicamentos, o uso de cigarros e bebidas e seguir a regra do \r\n        jejum total oito horas antes da cirurgia. Depois da alta (geralmente o paciente pode ir para casa no dia seguinte à \r\n        cirurgia), o repouso pode variar de 10 dias a dois meses, mas independentemente deste tempo, é necessário seguir alguns \r\n        cuidados para que a abdominoplastia tenha os melhores resultados possíveis.\r\n      </p>\r\n      <p>\r\n        São eles:\r\n      </p>\r\n\r\n      <ul>\r\n        <li>Dormir de barriga para cima e com as pernas sempre flexionadas (pelo menos nos primeiros 15 dias);</li>\r\n        <li>Tomar banho de chuveiro é possível já no dia seguinte. E a equipe cirúrgica realiza a troca de curativos após 4 dias;</li>\r\n        <li>Usar cinta modeladora e meias de compressão (a cinta modeladora deve ser retirada apenas para tomar banho, porque é ela \r\n        que alivia as dores e evita que as cicatrizes sejam complicadas). No caso, das meias de compreensão, a retirada só pode \r\n        ser feita quando a pessoa retorna as atividades diárias;</li>\r\n        <li>Troca de curativo (a primeira troca deve ser feita 4 dias depois da cirurgia, pela equipe médica, de forma delicada, \r\n        seguindo as orientações médicas);</li>\r\n        <li>Exercícios físicos leves (não é recomendado que o paciente pegue peso após a cirurgia, mas neste caso, é bom movimentar \r\n        as penas a cada duras horas para evitar coágulos na região operada);</li>\r\n      </ul>\r\n    </div>\r\n    `\n    },\n    {\n        id: 11,\n        type: \"external\",\n        mix: \"others\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/lipoaspiracao.jpg\",\n        imgAlt: \"Lipoaspira\\xe7\\xe3o\",\n        title: \"Lipoaspira\\xe7\\xe3o\",\n        descr: `Consiste na aspiração de gordura através de uma cânula com a finalidade de melhorar o contorno \r\n    corporal e refazer a silhueta do corpo. Melhor indicada para áreas de gordura localizada, que não diminuem \r\n    com exercício e dieta.`,\n        url: \"lipoaspiracao\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        A famosa “lipo”, também chamada de lipoaspiração é uma cirurgia muito procurada e conhecida pelas mulheres \r\n        que querem remodelar a barriga e o corpo, reduzindo as gorduras localizadas.\r\n      </p>\r\n      <p>\r\n        Além do abdome, a lipoaspiração também pode ser feita em outras regiões do corpo como cintura, dorso alto e \r\n        baixo, culote, face interna dos joelhos e até mesmo nos braços.\r\n      </p>\r\n      <p>\r\n        A equipe utiliza soro fisiológico e medicação sobre a gordura que será aspirada e no fim todas as incisões \r\n        são fechadas e protegidas com um curativo, seguidas de uma cinta compressiva que serve para diminuir o inchaço. \r\n        A lipoaspiração dura em média de 1 a 3 horas, dependendo do caso.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Variedades da lipoaspiração</h2>\r\n      <p>\r\n        A lipoescultura consiste numa variação da lipoaspiração onde, além dos procedimentos usuais da lipoaspiração, se \r\n        realiza a colocação da gordura (procedimento conhecido como lipoenxertia) retirada da própria paciente em outras regiões.\r\n      </p>\r\n      <p>\r\n        A região mais frequente onde se injeta gordura é a glútea (nádegas), mas outras regiões podem ser endereçadas como \r\n        depressões localizadas (congênitas ou resultantes de cirurgias prévias), sulcos da face (sulco nasogeniano) e lábios.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Cuidados depois da cirurgia</h2>\r\n      <p>\r\n        Para que os resultados sejam mais efetivos, o paciente precisa investir na recuperação e nos cuidados pós-operatórios. \r\n        A cinta compressiva por exemplo, deve ser usada durante a maior parte do tempo no primeiro mês e só pode ser retirada \r\n        na hora do banho. No segundo mês, ainda é preciso usá-la durante 12 horas. Além disso é importante beber muita água, \r\n        deixando o corpo hidratado e adotar uma dieta saudável e balanceada.\r\n      </p>\r\n      <p>\r\n        Se houver possibilidades, fazer drenagem linfática também é uma coisa que potencializa os resultados. É importante que \r\n        o paciente não fume pelo menos um mês depois da cirurgia e não faça exercícios físicos pesados. A exposição ao sol também \r\n        deve ser evitada. Cada caso tem suas particularidades, mas ao seguir esses cuidados, o paciente tem mais chances de uma \r\n        recuperação e cicatrização tranquila.\r\n      </p>\r\n    </div>\r\n    `\n    },\n    {\n        id: 12,\n        type: \"external\",\n        mix: \"others\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/rec-mamaria.jpg\",\n        imgAlt: \"Reconstru\\xe7\\xe3o Mam\\xe1ria\",\n        title: \"Reconstru\\xe7\\xe3o Mam\\xe1ria\",\n        descr: `A reconstrução da mama é conseguida através de várias técnicas de cirurgia plástica que tentam \r\n    restaurar a mama considerando-se a forma, a aparência e o tamanho após a retirada do tumor (nodulectomia) \r\n    ou da mama inteira (mastectomia).`,\n        url: \"reconstrucao-mamaria\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        Indicada para mulheres que tiveram os seios removidos por causa de um problema de saúde, ou para quem quer alterar a \r\n        forma, o tamanho e a aparência dos seios, a reconstrução mamária é uma opção bastante procurada.\r\n      </p>\r\n      <p>\r\n        O tempo da cirurgia varia muito conforme a situação da paciente e é comum que além da reconstrução mamária, o cirurgião \r\n        opte por procedimentos complementares.\r\n      </p>\r\n      <p>\r\n        De forma geral, a reconstrução mamária se divide em fases, desde a avaliação, a retirada de excessos a reconstrução das \r\n        glândulas e não existe uma regra para o que vem primeiro, já que cada caso tem suas particularidades.\r\n      </p>\r\n      <p>\r\n        Durante a cirurgia, é possível reconstruir desde o mamilo até a aréola inteira. Para este tipo de procedimento, também \r\n        vale destacar a necessidade de uma anestesia geral.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Preparação da cirurgia</h2>\r\n      <p>\r\n        Independente do contexto, toda pessoa que passa por uma reconstrução mamária precisa seguir alguns passos. O primeiro \r\n        é uma conversa com o especialista para alinhar expectativas.\r\n      </p>\r\n      <p>\r\n        Depois disso, é preciso fazer exames laboratoriais como hemograma, eletrocardiograma ultrassom e mamografia.\r\n      </p>\r\n      <p>\r\n        O uso de medicamentos também deve ser cortado, especialmente se forem aspirinas ou anti-inflamatórios e remédios naturais.\r\n      </p>\r\n      <p>\r\n        Caso o paciente fume, é importante largar o cigarro antes da cirurgia e por fim, é necessário ficar em jejum absoluto \r\n        oito horas antes do procedimento.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Após o procedimento</h2>\r\n      <p>\r\n        Além de evitar esforços físicos e exposição ao sol, o paciente precisa ficar atento a um dreno temporário que \r\n        é colocado sobre a pele para sangue e fluído.\r\n      </p>\r\n      <p>\r\n        Seguir os cuidados de higiene e de curativo e tomar os medicamentos ajuda a reduzir o risco de infecção.\r\n      </p>\r\n      <p>\r\n        Além disso, não é aconselhável fumar após a cirurgia e é recomendado ter uma alimentação adequada para que a recuperação \r\n        seja de sucesso. Assim como nas demais cirurgias, é necessário que o paciente faça acompanhamento médico, informando \r\n        o especialista de todas as condições da cirurgia.\r\n      </p>\r\n    </div>\r\n    `\n    },\n    {\n        id: 13,\n        type: \"external\",\n        mix: \"others\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/ginecomastia.jpg\",\n        imgAlt: \"Ginecomastia\",\n        title: \"Ginecomastia\",\n        descr: `A correção da ginecomastia está indicada nos casos relacionados a influências hormonais na \r\n    juventude e não regridem após a puberdade. Em casos relacionados ao aumento de peso também pode ser \r\n    realizada se não houver reversão do quadro.`,\n        url: \"ginecomastia\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        A ginecomastia é uma condição na qual homens possuem um aumento de tecido nas glândulas mamárias que atinge 60% dos homens.\r\n      </p>\r\n      <p>\r\n        Geralmente a cirurgia é indicada para os homens que mesmo após a fase da puberdade, continuam sofrendo com este problema \r\n        e o tempo de cirurgia varia muito conforme a situação das glândulas, durando geralmente entre uma e duas horas.\r\n      </p>\r\n      <p>\r\n        Em casos onde existe apenas o acúmulo da gordura e a glândula não aumenta tanto assim, uma lipoaspiração já resolve o problema.\r\n      </p>\r\n      <p>\r\n        Agora quando a glândula mamária fica está com uma condição de hipertrofia, o cirurgião precisa realizar uma incisão simples \r\n        para retirar este excesso.\r\n      </p>\r\n      <p>\r\n        Dependendo do caso, pode haver necessidade de técnicas combinadas, principalmente quando há excesso de pele e flacidez.\r\n      </p>\r\n      <p>\r\n        Nesta situação, além de remover os tecidos, o especialista precisa adequar a posição do mamilo e da aréola para que o tórax \r\n        fique em harmonia com os mamilos.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Antes e depois</h2>\r\n      <p>\r\n        Além da avaliação médica, o paciente que passa pela ginecomastia precisa realizar exames pré-operatórios de rotina e \r\n        avaliação das mamas com uma ultrassonografia.\r\n      </p>\r\n      <p>\r\n        Ao seguir essas recomendações, a recuperação do paciente acontece de forma gradual e saudável e em caso de qualquer \r\n        sintoma como falta de ar, dores no peito ou batimentos cardíacos anormais, o cirurgião deve ser procurado.\r\n      </p>\r\n      <p>\r\n        Depois de operar, o paciente precisa seguir alguns cuidados como, por exemplo:\r\n      </p>\r\n\r\n      <ul>\r\n        <li>Dormir de barriga para cima durante 30 dias;</li>\r\n        <li>Fazer acompanhamento médico;</li>\r\n        <li>Não fumar durante 15 dias após a cirurgia;</li>\r\n        <li>Usar um colete de elástico para melhorar a aderência da pele ao tórax durante 30 dias;</li>\r\n      </ul>\r\n    </div>\r\n    `\n    },\n    {\n        id: 14,\n        type: \"external\",\n        mix: \"others\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/mamoplastia.jpg\",\n        imgAlt: \"Mamoplastia\",\n        title: \"Mamoplastia\",\n        descr: `A mamoplastia de redução consiste na redução de mamas grandes ou aumento de mamas pequenas, \r\n    elevação e simetrização destas. Além disso, pode ser utilizada com forma de reconstrução de mamas \r\n    retiradas em casos de câncer.`,\n        url: \"mamoplastia\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        Assim como a prótese de silicone, a mamoplastia é uma cirurgia para os seios, com a diferença que ela pode aumentar \r\n        ou reduzir o tamanho dessa parte do corpo.\r\n      </p>\r\n      <p>\r\n        No caso da mamoplastia de aumento, o cirurgião também realiza incisões na região para implantar a prótese com o formato, \r\n        a textura e o tamanho adequado escolhido pela mulher.\r\n      </p>\r\n      <p>\r\n        Já na mamoplastia redutora, o cirurgião faz algumas incisões que começam ao redor da aréola e vão até o sulco mamário \r\n        e horizontal desta parte do corpo que também é conhecida como “T” invertido.\r\n      </p>\r\n      <p>\r\n        Depois disso, é feita a mobilização do tecido mamário e a redução do excesso de mama conforme a necessidade da paciente.\r\n      </p>\r\n      <p>\r\n        Além de diminuir ou aumentar os seios, a mamoplastia também é indicada para a reconstrução das mamas que sofreram acidentes \r\n        ou retiradas em função de um câncer.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Antes e depois</h2>\r\n      <p>\r\n        Assim como nos outros procedimentos, nunca é demais lembrar que a paciente deve estar segura de si para aderir a \r\n        mamoplastia. É necessário também realizar exames de rotina como os de sangue e eletrocardiograma além de exames de \r\n        imagem como a mamografia, ultrassonografia e seguir toda as orientações médicas em relação a jejum e ao tempo de internação.\r\n      </p>\r\n      <p>\r\n        Depois da mamoplastia, a mulher deve redobrar os cuidados na fase pós-operatória, tais como:\r\n      </p>\r\n\r\n      <ul>\r\n        <li>Usar sutiã cirúrgico ou sutiã de sustentação durante 30 dias;</li>\r\n        <li>Não dormir de lado por um mês e evitar dormir na posição de bruços;</li>\r\n        <li>Evitar exercícios físicos por 90 dias;</li>\r\n        <li>Não passar creme no corte cirúrgico;</li>\r\n        <li>Cuidar da higiene e dos pontos com delicadeza;</li>\r\n      </ul>\r\n    </div>\r\n    `\n    },\n    {\n        id: 15,\n        type: \"external\",\n        mix: \"others\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/p-mama.jpg\",\n        imgAlt: \"Pr\\xf3tese de Mama\",\n        title: \"Pr\\xf3tese de Mama\",\n        descr: `A cirurgia de implante de silicone é a cirurgia plástica mais realizada no Brasil. Elas \r\n    aumentam o volume da mama. É indicada para mamas com volume pequeno, com leve queda, assimetrias e \r\n    reconstruções após cirurgias oncológicas.`,\n        url: \"protese-de-mama\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        Queridinha entre as mulheres que desejam aumentar o volume e a forma dos seios, a prótese de mama é uma cirurgia muito \r\n        procurada em todos os consultórios de cirurgia plástica.\r\n      </p>\r\n      <p>\r\n        Com anestesia peridural ou geral, a cirurgia de prótese de mama dura em média duas horas. Durante o procedimento, o \r\n        cirurgião faz uma incisão no sulco mamário ou na região da axila. Geralmente, a do sulco mamário é a opção mais utilizada, \r\n        considerando o acesso a região onde a prótese será colocada e escondida pelo sutiã.\r\n      </p>\r\n      <p>\r\n        Vale lembrar que a posição do implante depende muito da anatomia do paciente, mas em um contexto gera há duas formas: \r\n        abaixo da glândula mamária (procedimento conhecido como subglandular/subfascial) ou abaixo do músculo peitoral (submuscular).\r\n      </p>\r\n      <p>\r\n        Além dos exames pré-operatórios da rotina, é comum que o cirurgião peça para a paciente exames de imagem que são \r\n        complementares como ultrassom de mama ou mamografia.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Antes e depois</h2>\r\n      <p>\r\n        Conversar com o médico e avaliar qual o melhor formato, material e tamanho da prótese de silicone é uma coisa muito \r\n        importante para fazer antes da cirurgia.\r\n      </p>\r\n      <p>\r\n        É bom evitar medicamentos e estar em boas condições de saúde física e emocional para fazer a cirurgia e mesmo depois da \r\n        prótese implantada os cuidados continuam.\r\n      </p>\r\n      <p>\r\n        No primeiro mês, por exemplo, é fundamental evitar esforços físicos nos braços. Ou seja: nada de academia ou outros exercícios \r\n        físicos pesados.\r\n      </p>\r\n      <p>\r\n        Também é importante usar sutiã por 24h no primeiro mês e não é recomendado dormir de bruços, em cima da região operada. \r\n        Se você for fumante, esqueça o cigarro após o primeiro mês da cirurgia. Contrariar essa indicação afeta a cicatrização da \r\n        cirurgia e consequentemente os resultados.\r\n      </p>\r\n      <p>\r\n        Também não se deve tomar sol em um período de 2 a 3 meses após o procedimento. Mesmo depois deste tempo, a exposição poder \r\n        ser realizada desde que as cicatrizes estejam cobertas com um esparadrapo branco.\r\n      </p>\r\n    </div>\r\n    `\n    },\n    {\n        id: 16,\n        type: \"external\",\n        mix: \"others\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/ex-obesos.jpg\",\n        imgAlt: \"Cirurgia em Ex-obesos\",\n        title: \"Cirurgia em Ex-obesos\",\n        descr: `Se você sofreu dramática redução ponderal, quer por dieta e exercício físico, quer seja por \r\n    cirurgia bariátrica (cirurgia de obesidade), e atingiu seu peso ideal, então você pode ser um bom candidato \r\n    a este tipo de cirurgia.`,\n        url: \"cirurgia-em-ex-obesos\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        Em situações de ganho ou de perca de peso em um curto período, é comum que a elasticidade da pele se perca, dando \r\n        lugar a gordura e a flacidez. Para corrigir este problema, a cirurgia de contorno temporal é uma das mais indicadas \r\n        por especialistas.\r\n      </p>\r\n      <p>\r\n        Durante o procedimento, o cirurgião retira o excesso de pele, e desta forma remodela o corpo e “levanta” a pele caída e enrugada.\r\n      </p>\r\n      <p>\r\n        Geralmente a cirurgia para ex-obesos está associada a outros tipos de cirurgia como a lipoaspiração e o lifting branquial, \r\n        por exemplo. Essa necessidade é avaliada conforme o quadro do paciente e independente do número de combinações, uma avaliação \r\n        médica antes da cirurgia é muito importante para que os resultados sejam alcançados.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Antes e depois da cirurgia</h2>\r\n      <p>\r\n        De forma geral, a idade do paciente e o número de áreas com flacidez bem como a qualidade da pele afetam diretamente o \r\n        sucesso da cirurgia. Assim como nos demais procedimentos, o paciente precisa realizar alguns exames de rotina e se preparar \r\n        para o período pré-operatório não tomando medicamentos e nem ingerindo álcool e cigarro.\r\n      </p>\r\n      <p>\r\n        Após a cirurgia, é importante que a pessoa não pegue sol em um período de dois meses e, além disso a higiene deve ser feita \r\n        com anti-séptico de forma cuidadosa sobre as incisões.\r\n      </p>\r\n      <p>\r\n        Cuidar da alimentação e manter o corpo hidratado também é muito importante para a preservação dos resultados. Por isso, \r\n        fazer acompanhamento médico e nutricional é uma boa dica para quem passa pela cirurgia de contorno corporal.\r\n      </p>\r\n      <p>\r\n        O tempo total de recuperação varia conforme o número de combinações cirúrgica para cada caso.\r\n      </p>\r\n    </div>\r\n    `\n    },\n    {\n        id: 17,\n        type: \"external\",\n        mix: \"others\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/combinadas.jpg\",\n        imgAlt: \"Cirurgias Combinadas\",\n        title: \"Cirurgias Combinadas\",\n        descr: `As associações em cirurgia plástica têm sido um recurso bastante utilizado. A grande vantagem \r\n    destas associações de cirurgia é o bom resultado obtido em um único procedimento que traz grande economia \r\n    de tempo e dinheiro para o paciente.`,\n        url: \"cirurgias-combinadas\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <h2 class=\" mb-40 mb-xs-30\">Conheça mais detalhes</h2>\r\n      <p>\r\n        No universo das cirurgias plásticas, as cirurgias combinadas têm crescido bastante e chamam a atenção de pacientes \r\n        que desejam corrigir mais de uma imperfeição ao mesmo tempo.\r\n      </p>\r\n      <p>\r\n        Um destes exemplos é a própria cirurgia para ex-obesos que dependendo da flacidez e da situação pode ser combinada \r\n        com uma lipoaspiração por exemplo, mas as combinações não param por aí.\r\n      </p>\r\n      <p>\r\n        Muitas pessoas que fazem lipoaspiração também optam pela abdominoplastia e como ambas cirurgias são realizadas na \r\n        barriga, com o objetivo de secar a gordura localizada, a combinação potencializa os resultados.\r\n      </p>\r\n      <p>\r\n        Outras pessoas fazem questão de combinar a lipoaspiração com uma mamoplastia por exemplo e ainda há os que fazem \r\n        uma rinoplastia com uma blefaroplastia e assim por diante.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Como saber se você é um(a) bom(boa) candidato(a)?</h2>\r\n      <p>\r\n        A combinação de cirurgias é um recurso que sem dúvidas, poupa o tempo e a disposição dos pacientes. Mas é bom lembrar \r\n        que tudo deve passar pela avaliação médica, considerando aspectos como tempo de recuperação e condições físicas de \r\n        saúde do paciente.\r\n      </p>\r\n      <p>\r\n        É importante lembrar que somente a vontade sem a real necessidade não é um motivo suficiente para realizar mais de \r\n        uma cirurgia. Em casos que o paciente sofre com doenças como pressão alta, anemia e diabetes, por exemplo, as cirurgias \r\n        combinadas não são uma boa opção.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Antes e depois da cirurgia</h2>\r\n      <p>\r\n        Além da avaliação médica, os cuidados com exames de rotina, jejum e ausência de cigarro também prevalecem para as cirurgias \r\n        combinadas. No caso dos cuidados pós-operatórios, a necessidade varia conforme o tipo de cirurgia.\r\n      </p>\r\n      <p>\r\n        Em geral, a exposição ao sol, a higiene e o repouso são coisas que ajudam e interferem na recuperação do paciente.\r\n      </p>\r\n    </div>\r\n    `\n    },\n    {\n        id: 18,\n        type: \"external\",\n        mix: \"others\",\n        href: \"main-portfolio-single-1.html\",\n        imgSrc: \"/assets/images/surgeries/ninfoplastia.jpg\",\n        imgAlt: \"Ninfoplastia\",\n        title: \"Ninfoplastia\",\n        descr: `A ninfoplastia ou cirurgia da intimidade consiste na correção da hipertrofia (aumento) dos pequenos \r\n    lábios na região genital feminina, geralmente a remoção de gordura ou excesso de pele pode corrigir o aumento.`,\n        url: \"ninfoplastia\",\n        content: `\r\n    \r\n    <div class=\"container\">\r\n      <p>\r\n        A Ninfoplastia é um procedimento cirúrgico que visa auxiliar mulheres com hipertrofia na região íntima.\r\n      </p>\r\n      <p>\r\n        E, apesar de ser um procedimento cirúrgico que pode melhorar diretamente o bem-estar e autoestima da paciente, \r\n        muitas mulheres ainda o desconhecem ou tem dúvidas sobre o assunto.\r\n      </p>\r\n      <p>\r\n        Se você é uma das que possui dúvidas sobre a Ninfoplastia, continue lendo esse post e descubra:\r\n      </p><br>\r\n\r\n      <strong>• O que é a Ninfoplastia;</strong><br><br>\r\n\r\n      <strong>• Para quem ela é indicada;</strong><br><br>\r\n\r\n      <strong>• Quais são os benefícios gerados por esse procedimento;</strong><br><br>\r\n\r\n      <strong>• Como funciona a Ninfoplastia;</strong><br><br>\r\n\r\n      <strong>• Quem pode fazer esse tipo de procedimento.</strong><br><br>\r\n\r\n      <strong>Confira!</strong><br><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Ninfoplastia: O que é?</h2>\r\n      <p>\r\n        A Ninfoplastia se trata de um procedimento cirurgico que faz a correção de imperfeições relacionadas ao tamanho \r\n        dos pequenos lábios.\r\n      </p>\r\n      <p>\r\n        Essa estrutura fica situada na entrada da vagina e é responsável por proteger essa região. Quando os pequenos \r\n        lábios são hipertrofiados, além de gerar desconforto estético em muitas mulheres, também pode prejudicar as relações \r\n        sexuais, causando dor e desconforto.\r\n      </p>\r\n      <p>\r\n        Por esse e outros motivos é que muitas mulheres acabam aderindo a Ninfoplastia para a correção desse tipo de problema.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Para quem é indicada a Ninfoplastia?</h2>\r\n      <p>\r\n        Na maioria dos casos, este procedimento é indicado para mulheres que se sentem desconfortáveis esteticamente com a \r\n        estrutura dos seus pequenos lábios ou que sentem dor durante a relação sexual ocasionada por esse tipo de alteração. \r\n        Mas, também existem os casos clínicos onde essa cirurgia se faz necessária.\r\n      </p>\r\n      <p>\r\n        Em alguns quadros, a hipertrofia é tão grave que a paciente sente muita dificuldade na hora de fazer a higienização \r\n        correta da vagina. Isso gera o acúmulo de secreções, o que pode gerar uma série de complicações, desde candidíase, \r\n        até infecções urinárias.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Quais são os seus benefícios da Ninfoplastia?</h2>\r\n      <p>\r\n        A Ninfoplastia traz uma série de benefícios para mulher. Começando pelo fato da autoestima melhorar bastante, tendo \r\n        em vista que a hipertrofia dos pequenos lábios pode afetar diretamente o emocional da paciente.\r\n      </p>\r\n      <p>\r\n        Além disso, a dor nas relações sexuais geradas em função da hipertrofia, desaparece com o tempo, logo após o procedimento, \r\n        fazendo com que a mulher consiga ter uma vida sexual saudável, sem qualquer incômodo.\r\n      </p>\r\n      <p>\r\n       Isso sem contar na parte da higienize, que se torna mais fácil para paciente que antes tinha dificuldades por conta do \r\n       excesso de pele na região dos pequenos lábios.\r\n      </p>\r\n      <p>\r\n        Basicamente, a Ninfoplastia afeta diretamente o bem-estar da mulher, melhorando a sua qualidade de vida.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Como funciona</h2>\r\n      <p>\r\n        A Ninfoplastia é feita utilizando anestésico e a paciente pode ou não ser sedada. Ela dura entre quarenta minutos e uma hora.\r\n      </p>\r\n      <p>\r\n        Durante a operação, o cirurgião irá cortar uma parte dos pequenos lábios, afim de deixa-los menores. Em seguida, ele \r\n        fará a reconstrução deles, para que a paciente não fique com qualquer tipo de cicatriz.\r\n      </p>\r\n      <p>\r\n       Na verdade, após a recuperação dificilmente é possível perceber que a mulher passou por uma Ninfoplastia.\r\n      </p>\r\n      <p>\r\n        Um dos grandes diferenciais dessa interversão cirúrgica é que a sutura é feita com fios absorvíveis. Ou seja, eles \r\n        serão absorvidos de forma natural pelo organismo, sendo desnecessária a volta da paciente ao hospital para retirada \r\n        dos pontos.\r\n      </p>\r\n      <p>\r\n        De modo geral a paciente tem alta no mesmo dia do procedimento. É possível retornar a atividades diárias em três dias, \r\n        e a ter relações sexuais em três semanas.\r\n      </p><br>\r\n\r\n      <h2 class=\"pt-10 mb-40 mb-xs-30\">Quem pode fazer a Ninfoplastia?</h2>\r\n      <p>\r\n        Apesar de ser uma intervenção cirúrgica relativamente simples, precisa ser realizada por alguém especializado na área. \r\n        Do contrário a paciente corre o risco de não ter o resultado desejado, e ainda ficar com cicatrizes na sua região íntima.\r\n      </p>\r\n    </div>\r\n    `\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/surgeries.js\n");

